    true,nt"url": null,nt"notes": "Patient appointment information is obtained
    from the Veterans Health Information Systems and Technology Architecture Scheduling
    module.  The Patient Appointment Information application gathers appointment data
    to be loaded into a national database for statistical reporting. Patient appointments
    are scanned from September 1, 2002 to the present, and appointment data meeting
    specified criteria are transmitted to the Austin Information Technology Center Patient
    Appointment Information Transmission (PAIT) national database.  Subsequent transmissions
    (bi-monthly) update PAIT bi-monthly via Health Level Seven message transmissions
    through Vitria Interface Engine (VIE) connections. A Statistical Analysis Software
    (SAS) program in Austin utilizes PAIT data to create a bi-monthly SAS dataset on
    the Austin mainframe.  This additional data is used to supplement the existing Clinic
    Appointment Wait Time and Clinic Utilization extracts created by the Veterans Health
    Administration Support Service Center (VSSC).",nt"license_title": "Creative
